import PropTypes from 'prop-types';
import { useStyles } from '../styles';

const Arrow = ({ expanded, styles }) => (
  <span
    style={{
      ...styles.base,
      ...(expanded ? styles.expanded : styles.collapsed),
    }}>
    ▶
