);

const TreeNode = memo(props => {
  props = {
    expanded: true,
    nodeRenderer: ({ name }) => <span>{name}</span>,
    onClick: () => {},
    shouldShowArrow: false,
    shouldShowPlaceholder: true,
    ...props,
  };
  const {
    expanded,
    onClick,
    children,
    nodeRenderer,
    title,
    shouldShowArrow,
    shouldShowPlaceholder,
